import { useQuery } from "react-query";
import { CoursesCardsList } from "../components/molecules/CoursesCardsList";
import { CoursesTagsSideBar } from "../components/molecules/CoursesTagsSideBar";
import { CoursesApi } from "../api/CoursesApi";
import { COURSES_TAGS } from "../types/Course";

export const CoursesListPage = () => {
  const { data: coursesList, isLoading: isCoursesListLoading } = useQuery(
    ["getCoursesList"],
    () => CoursesApi.getCourses()
  );

  console.log(coursesList);

  const CARDS: any = [];
  return (
    <div className="courses-list-page">
      <CoursesTagsSideBar tags={Object.values(COURSES_TAGS)} currentTag={1} />
      <CoursesCardsList cards={CARDS} />
    </div>
  );
};
